import React, { Component } from "react";
import axios from "axios";

import "../styles/jukebox.css";

class Jukebox extends Component {
  constructor(props) {
    super(props);
    const songs = [];
    this.state = { songs };

    this.getSpotify = this.getSpotify.bind(this);
  }
  getSpotify() {
    axios
      .get("/spotify-req", {
        params: {}
      })
      .then(res => {
        console.log(res.data.songOptions);
        console.log(res.data.answer);
        console.log("it called a thing");
      })
      .catch(err => {});

    this.setState({ songs: [] });
  }
  render() {
    return (
      <div>
        <button id="graph-go" onClick={this.getSpotify}>
          Start
        </button>
        {this.state.songs.map((songs, index) => (
          <p key={index}>
            Hello, {songs.name} from {songs.country}!
          </p>
        ))}
      </div>
    );
  }
}
export default Jukebox;

